css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document domain("liveleak.com") {

body {
	background-color: #111 !important;
	}
    
	*			{ color: #777 !important; border-color: #444 !important; }
	a,
	a *			{ color: #626F6F !important; text-decoration: none !important; }

	a:visited,
	a:visited *		{ color: #6E6065 !important; }


#content #leftcol {
    background-color: #333;
	}
	
.tab_nav_large, .scroll_list, .tab_nav_top, .tab_nav_bottom, .tab_nav {
    background: #333 !important;
	}
	
#content_box, .tab_nav_large_bottom, #rightcol {
    background: #2a2a2a !important;
	}	
	
.tabs, .sidebox, .msg, #search_input, .tab_nav_large_top, .item_info_column img, .pagenav img, .section_title img {
	filter: invert(80%);
	}
	
.divide {
    background: #414141 !important;
	}
	
#footer, #logo, #nav {
	filter: grayscale(1);
	}
	
.red_button {
    color: #FFF !important;
	}

body, #header p {
    background: none;
	}
	
.form_button span, .form_button {
    color: #000 !important;
    background: url("http://i.imgur.com/kFMRXco.png") no-repeat scroll right top transparent;
	}
	
#nav li a.firstlevela {
    color: #ccc !important;
	}
}
